import {
	STATUS_COURSES,
	FETCH_COURSES,
	MESSAGE_COURSES,
} from 'constants/types/courses';

export const statusCourse = (status) => ({
	type: STATUS_COURSES,
	payload: status,
});

export const fetchCourse = (courses) => ({
	type: FETCH_COURSES,
	payload: courses,
});

export const messageCourse = (message) => ({
	type: MESSAGE_COURSES,
	payload: message,
});
